import React from 'react';
import BookingForm from '../components/BookingForm';
import { Navbar } from '../components';
import '../styles/bookform.css';

const BookTime = () => {
  return (

    <div>
        <Navbar/>
      <h2 className='book-time-text'>Book an Appointment</h2>
      <BookingForm />
    </div>
  );
};

export default BookTime;
